<p style="font-size: 24px;" class="font_8">&nbsp;</p>

<p style="font-size: 24px;" class="font_8"><span style="font-size:24px;"><span style="font-family:sacramento,cursive;">I hope you haven't forgotten me, the one who’s your creator!</span></span></p>

<p style="font-size: 24px;" class="font_8">&nbsp;</p>

<p style="font-size: 24px;" class="font_8"><span style="font-size:24px;"><span style="font-family:sacramento,cursive;">I am dreaming about you, the person I want to be!</span></span></p>

<p style="font-size: 24px;" class="font_8">&nbsp;</p>

